import Link from 'next/link';

const NavBar = () => (
  <nav className="navbar navbar-expand navbar-dark bg-dark mb-4">
    <div className="container">
      <li>
        <Link href="/"><a className="nav-link">Home</a></Link>
      </li>
      <li>
        <Link href="/about">About</Link>
      </li>
    </div>
  </nav>
);

export default NavBar;
